function Confirm1() {

    return (
        <>
        <h2>나의 내일에게</h2>
        <p>유리병을 바다로 떠나보냈어요.</p>
        <p>2023년 00월 00일에</p>
        <p>철수님께 찾아갈게요!</p>
        <button>받는 이에게 편지 링크 공유하기</button><br></br>
        <button>편지함으로</button>
        <button>새로운 편지하기</button>
        </>
    );
}

export default Confirm1;
